import React from 'react';
import './recognize.css';

export const Recognize = () => {
  return (
    <div>
        <div className='mirror__scan'>
            <div className='mirror__bg first'></div>
            <div className='mirror__bg second'></div>
        </div>
    </div>
  )
}
